import { promises as fs } from 'fs';
import path from 'path';
import fetch from 'node-fetch';
import pkg from '@whiskeysockets/baileys';

const { generateWAMessageFromContent, proto } = pkg;
import config from '../config.cjs';

const chatHistoryFile = path.resolve(__dirname, '../gpt_chat_history.json');

const GPT_APIS = [
    "https://api.dreaded.site/api/chatgpt?text=",
    "https://api.safone.me/chatgpt?query=",
    "https://api.ownthink.com/bot?appid=xiaosi&userid=user&spoken=" // Backup API
];

async function readChatHistory() {
    try {
        const data = await fs.readFile(chatHistoryFile, "utf-8");
        return JSON.parse(data) || {};
    } catch (err) {
        return {};
    }
}

async function writeChatHistory(chatHistory) {
    try {
        await fs.writeFile(chatHistoryFile, JSON.stringify(chatHistory, null, 2));
    } catch (err) {
        console.error("Error writing chat history:", err);
    }
}

async function updateChatHistory(chatHistory, sender, role, content) {
    if (!chatHistory[sender]) chatHistory[sender] = [];
    chatHistory[sender].push({ role, content });

    if (chatHistory[sender].length > 20) {
        chatHistory[sender] = chatHistory[sender].slice(-20);
    }

    await writeChatHistory(chatHistory);
}

async function fetchGPTResponse(prompt) {
    for (let api of GPT_APIS) {
        try {
            const response = await fetch(api + encodeURIComponent(prompt));
            if (!response.ok) throw new Error(`API error: ${response.status}`);

            const data = await response.json();
            return data.result?.response || data.data || data.message || "No response.";
        } catch (err) {
            console.error(`API failed: ${api}`, err);
        }
    }
    return "All GPT APIs failed. Try again later.";
}

const gptBot = async (m, Matrix) => {
    const chatHistory = await readChatHistory();
    const text = m.body.trim().toLowerCase();

    if (!text.startsWith("gpt")) return;

    const prompt = text.slice(3).trim();
    if (!prompt) {
        await Matrix.sendMessage(m.from, { text: "Please provide a prompt." }, { quoted: m });
        return;
    }

    await m.React("â³");

    const response = await fetchGPTResponse(prompt);

    await updateChatHistory(chatHistory, m.sender, "user", prompt);
    await updateChatHistory(chatHistory, m.sender, "assistant", response);

    await Matrix.sendMessage(m.from, { text: response }, { quoted: m });
    await m.React("âœ…");
};

export default gptBot;
